pragma solidity ^0.5.0;

contract ChainBNBProperty {
    string propertyAddress;
    
    enum Status { Vacant, Occupied }
    Status currentStatus;
    
    bool isBiddingActive;
    
    uint baseRent;
    uint currentRent;
    uint highestBid;
    uint numberOfBids;

    address payable public propertyOwner;
    
    event OccupyProperty(address _occupant, uint _value);

    constructor(uint _baseRent, string memory _propertyAddress) public {
        propertyAddress = _propertyAddress;
        currentStatus = Status.Vacant;
        isBiddingActive = false;
        baseRent = _baseRent;
        currentRent = _baseRent;
    }

    modifier ifVacant {
        require(currentStatus == Status.Vacant, "The property is currently occupied!");
        _;
    }

    modifier ifNotBiddingActive {
        require(isBiddingActive == false, "Bidding is active on this property. Bid instead!");
        _;
    }

    modifier ifCorrectRentProvided {
        require(msg.value == currentRent, "Incorrect rent provided!");
        _;
    }

    function reserveProperty() payable ifVacant ifNotBiddingActive ifCorrectRentProvided public {
        currentStatus = Status.Occupied;
        isBiddingActive = false;
        propertyOwner.transfer(msg.value);
        emit OccupyProperty(msg.sender, msg.value);
    }

    function setBaseRent(uint _newBaseRent) public {
        baseRent = _newBaseRent;
    }

    function getStatus() public view returns(Status) {
        return currentStatus;
    }

    function getBaseRent() public view returns(uint) {
        return baseRent;
    }

}
